import React from 'react'
import './styles/streamers.css'
import InfoLogin from './InfoLogin'
import Cuerpostreams from '../components/Cuerpostreams'

class Streamers extends InfoLogin {

render(){
    return (
            <div className="container">
                <div className="row mt-2 justify-content-center">

                     <Cuerpostreams info={this.state.dataStreamersInfo} />

                     
                </div>
            </div>
    
    )
}
}
export default Streamers
